import axios from 'axios';

const API_URL = 'http://localhost:8080/api/Applications';

export const getApplications=()=>axios.get(API_URL);
export const createApplication=(Application)=> axios.post(API_URL, Application);
export const getApplication=(ApplicationID)=>axios.get(API_URL+'/'+ApplicationID);
export const updateApplication=(ApplicationID, Application)=>axios.put(API_URL +'/'+ApplicationID, Application);
export const deleteApplication=(ApplicationID)=>axios.delete(API_URL+'/'+ApplicationID);
